Description . Head (
Figs. 29–30
). Frons 1.2 times as long as wide, brownish yellow, rarely to dark brown, satin shining, very sparsely and finely, almost inconspicuously setulose, with round parafrontal microtichose spots and two pairs of calluses (oval swellings) posterior to its middle and slightly concave anterior half. Vertical plates usually black, with greenish or dark blue sheen, bearing 2 pairs of black, short, slightly reclinate orbital setae. Ocellar triangle black.

Thorax (
Fig. 30
). Scutum and scutellum brown to black, with dull green metallic sheen, finely rugulose, except antepronotum, posterior surface of postpronotal lobe and notopleuron, as well as pleura strongly shining; posterodorsal part of anepisternum shagreened; supra-alar area and tympanal fossa matt black, postscutellum black, gray microtrichose; postero-ventral margin of scutellum without microtrichose area. Mesonotal scutum with short medial row of setulae in anterior portion, pair of regular dorsocentral and intra-alar rows, all setae very fine and short, black; pair of hair-like acrostichal and dorsocentral seta. One postprononal, 2 postsutural supra-alar, one intra-alar and one postalar setae strong, black.

Female terminalia: eversible membrane (
Fig. 35
) with two pairs of long taeniae and membrane between them cowered by fine monodentate scales; posterior part of membrane with fine multidentate scales; aculeus (
Figs. 36– 37
) 6.5– 8 times as long as wide at base; vagina (
Figs. 38–39
) with simple, rod-like ventral receptacle; 3 spherical spermathecae (
Fig. 40
).
